import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";

export default function Home() {
  const [status, setStatus] = useState("Connecting...");

  useEffect(() => {
    fetch("/api/ping")
      .then((res) => res.text())
      .then((txt) => setStatus(txt))
      .catch(() => setStatus("Connection failed"));
  }, []);

  // Card component remains the same, but we'll add a hover effect for better UX
  const Card = ({ title, subtitle }) => (
    <div
      className="home-card" // Added a class for potential future CSS targeting
      style={{
        display: "block",
        textDecoration: "none",
        border: "1px solid #e5e7eb",
        borderRadius: 12,
        padding: "16px 20px",
        boxShadow: "0 2px 10px rgba(0,0,0,0.05)",
        cursor: "pointer",
        transition: "transform 0.2s ease, box-shadow 0.2s ease",
      }}
      onMouseOver={(e) => {
        e.currentTarget.style.transform = "translateY(-3px)";
        e.currentTarget.style.boxShadow = "0 4px 12px rgba(0,0,0,0.1)";
      }}
      onMouseOut={(e) => {
        e.currentTarget.style.transform = "translateY(0)";
        e.currentTarget.style.boxShadow = "0 2px 10px rgba(0,0,0,0.05)";
      }}
    >
      <div style={{ fontSize: 18, fontWeight: 700, marginBottom: 6, color: "#111827" }}>
        {title}
      </div>
      <div style={{ fontSize: 14, color: "#4b5563" }}>{subtitle}</div>
    </div>
  );

  return (
    <div style={{ fontFamily: "system-ui, -apple-system, Segoe UI, Roboto, sans-serif", background: "#f9fafb", minHeight: "100vh" }}>
      <header style={{ padding: "24px 20px", borderBottom: "1px solid #e5e7eb", background: "white" }}>
        <h1 style={{ margin: 0, fontSize: 28 }}>Password Utilities — Mark 0.2</h1>
        <p style={{ margin: "6px 0 0", color: "#6b7280" }}>
          Default landing page • Status: <strong>{status}</strong>
        </p>
      </header>

      <main style={{ padding: "20px", maxWidth: "700px", margin: "0 auto" }}>
        <section style={{ margin: "18px 0 16px" }}>
          <h2 style={{ margin: 0, fontSize: 20 }}>Tools & Pages</h2>
          <p style={{ marginTop: 6, color: "#6b7280" }}>
            Choose a tool or page to continue.
          </p>
        </section>

        {/* Updated container for vertical layout */}
        <div
          style={{
            display: "flex", // Changed from 'grid'
            flexDirection: "column", // Stack items vertically
            gap: 16,
          }}
        >
          <Link to="/generator" style={{ textDecoration: "none" }}>
            <Card title="Password Generator" subtitle="Create strong, memorable passwords" />
          </Link>
          <Link to="/strength" style={{ textDecoration: "none" }}>
            <Card title="Strength Checker" subtitle="Analyze password strength" />
          </Link>
          <Link to="/break" style={{ textDecoration: "none" }}>
            <Card title="Break-Time Estimator" subtitle="Estimate time to crack" />
          </Link>
          <Link to="/login" style={{ textDecoration: "none" }}>
            <Card title="Login" subtitle="Access premium features" />
          </Link>
          <Link to="/register" style={{ textDecoration: "none" }}>
            <Card title="Register" subtitle="Create an account" />
          </Link>
        </div>
      </main>

      <footer style={{ padding: 20, textAlign: "center", color: "#6b7280", marginTop: 40 }}>
        © {new Date().getFullYear()} Mark 0.2
      </footer>
    </div>
  );
}
